import { Image, Row, Col, Card } from 'react-bootstrap'



const ProjectsCard = () =>{

    return(

        <Row style={styles.projectDiv} key={props.key}>
            <Col xs={12} sm={12} md={6} lg={6} xl={6}>
                <Image src={require('../../assets/images/Projects' + props.image)} fluid/>
            </Col>
            <Col xs={12} sm={12} md={6} lg={6} xl={6}>
              <Card.Body style={styles.cardBody}>
                <Card.Title className="text-center">
                    {props.title}
                </Card.Title>
                <Card.Text className="text-center">
                    {props.description}
                </Card.Text>
                <div style={styles.iconsDiv}>

                </div>
              </Card.Body>
            </Col>
        </Row>

    )

}

const styles={
    projectDiv:{
        marginTop: '2em',
        marginBottom: '2em'
    },
   cardBody: {
       display: 'flex',
       flexDirection: 'column', 
       alignItems: 'center',
   },
   iconsDiv: {

   }
}

export default ProjectsCard;
